import React from "react";
const Monthly =
  "data:image/png;base64,";

  type props = {
  name: string;
};

function Base64Images(props: props) {
  switch (props.name) {
    case "Monthly":
      return <img src={Monthly} alt="" width={30} height={30} />;
    default:
      return null;
  }
}

export default Base64Images;
